        // 域名输入限制
        private void textBox_domain_KeyPress(object sender, KeyPressEventArgs e)
        {
            if ((e.KeyChar >= 'a' && e.KeyChar <= 'z') || (e.KeyChar >= 'A' && e.KeyChar <= 'Z')
                || (e.KeyChar >= '0' && e.KeyChar <= '9') || (e.KeyChar == 8) || (e.KeyChar == '.')
                || (e.KeyChar == '/') || (e.KeyChar == ':') || (e.KeyChar == 3) || (e.KeyChar == 22))
            {
                e.Handled = false;
            }
            else
            {
                e.Handled = true;
            }
        }

