        // 切页
        private void textBox_currentLogPage_KeyPress(object sender, KeyPressEventArgs e)
        {
            if (!(e.KeyChar >= '0' && e.KeyChar <= '9') && !(e.KeyChar == '\r') && !(e.KeyChar == 8))
            {
                e.Handled = true;
            }
            else 
            {
                e.Handled = false;
            }

            // 回车
            if (e.KeyChar == '\r') {
                int nSupportPage = 0;
                bool isParsable = Int32.TryParse(textBox_currentLogPage.Text, out nSupportPage);
                if (!isParsable) {
                    nSupportPage = 0;
                }
                if (nSupportPage >= _gLogPage) { nSupportPage = _gLogPage; }
                if (nSupportPage <= 1) { nSupportPage = 1; }

                _gLogCurrentPage = nSupportPage;

                int nCount = InitLog();
                if (nCount >= 0)
                {
                    _gLogCount = nCount;
                    if (_gLogCount % GLogPageSize == 0)
                    {
                        _gLogPage = _gLogCount / GLogPageSize;
                    }
                    else
                    {
                        _gLogPage = _gLogCount / GLogPageSize + 1;
                    }
                    UpdateTotalLogUi();
                    GetPageLog();
                    UpdatePageLogUi();
                }
            }
        }

        // 按下格子事件
        private void dataGridView_log_CellClick(object sender, DataGridViewCellEventArgs e)
        {
            if (e.RowIndex < 0) { return; }
            if (this.dataGridView_log.SelectedCells.Count != 1) {
                return;
            }
            if(this.dataGridView_log.SelectedCells[0].Value == null){
                return;
            }

            string text = this.dataGridView_log.SelectedCells[0].Value.ToString();
            int selectRow = this.dataGridView_log.SelectedCells[0].RowIndex;
            int selectColumn = this.dataGridView_log.SelectedCells[0].ColumnIndex;

            int domainColumn = dataGridView_log.Columns["Column_Domain"].Index;
            int viewColumn = this.dataGridView_log.Columns["Column_ViewPS"].Index;
            int downloadColumn = this.dataGridView_log.Columns["Column_DownloadPS"].Index;

            // 域名列
            if (selectColumn == domainColumn)
            {
                DataGridViewButtonCell cell = (DataGridViewButtonCell)this.dataGridView_log.SelectedCells[0];
                Clipboard.SetDataObject(cell.Value);
                label_log_copyinfo.Text = "已复制  " + cell.Value.ToString() + "  到剪切板，按Ctrl+V可粘贴";
            }
            // 查看截图
            else if (selectColumn == viewColumn)
            {
                object o = this.dataGridView_log.Rows[selectRow].Cells["Column_PrintScreen"].Value;
                byte[] pictureData = CommonFunc.ObjectToByteArray(o);

                showPicture form = new showPicture(pictureData);
                form.ShowDialog();
            }
            // 下载截图
            else if (selectColumn == downloadColumn) {
                object o = this.dataGridView_log.Rows[selectRow].Cells["Column_PrintScreen"].Value;
                byte[] pictureData = CommonFunc.ObjectToByteArray(o);
                string filename = DateTime.Now.ToString("yyyy_MM_dd_HH_mm_ss") + ".jpg";
                bool b = PictureFileUtility.SavePicture(pictureData, filename);
                if (b)
                {
                    MessageBox.Show("图片 " + filename + " 下载完毕.", "提示");
                }
                else {
                    MessageBox.Show("图片下载失败.", "错误");
                }
            }
        }
