        private void dataGridView_domain_CellClick(object sender, DataGridViewCellEventArgs e)
        {
            if (e.RowIndex < 0) { return; }
            if (this.dataGridView_domain.SelectedCells.Count != 1)
            {
                return;
            }
            if (this.dataGridView_domain.SelectedCells[0].Value == null)
            {
                return;
            }

            string text = this.dataGridView_domain.SelectedCells[0].Value.ToString();
            int selectRow = this.dataGridView_domain.SelectedCells[0].RowIndex;
            int selectColumn = this.dataGridView_domain.SelectedCells[0].ColumnIndex;

            int domainColumn = this.dataGridView_domain.Columns["Column_domain_domain"].Index;
            int modifyColumn = this.dataGridView_domain.Columns["Column_domain_update"].Index;
            int deleteColumn = this.dataGridView_domain.Columns["Column_domain_delete"].Index;
            int checkStatusColumn = this.dataGridView_domain.Columns["Column_domain_checkStatus"].Index;

            // 域名列
            if (selectColumn == domainColumn)
            {
                DataGridViewButtonCell cell = (DataGridViewButtonCell)this.dataGridView_domain.SelectedCells[0];
                Clipboard.SetDataObject(cell.Value);
                label_domain_copyInfo.Text = "已复制  " + cell.Value.ToString() + "  到剪切板，按Ctrl+V可粘贴";
            }
            // 修改本域名
            else if (selectColumn == modifyColumn)
            {
                DomainInfo ds = new DomainInfo();
                try
                {
                    ds.DomainIndex = Int32.Parse(this.dataGridView_domain.Rows[selectRow].Cells["Column_domain_domainIndex"].Value.ToString());
                }
                catch (FormatException)
                {
                    ds.DomainIndex = 0;
                }
                ds.Product = this.dataGridView_domain.Rows[selectRow].Cells["Column_domain_company"].Value.ToString();
                ds.Domain = this.dataGridView_domain.Rows[selectRow].Cells["Column_domain_domain"].Value.ToString();
                try
                {
                    ds.IsNeedCheck = Int32.Parse(this.dataGridView_domain.Rows[selectRow].Cells["Column_domain_checkStatus"].Value.ToString());
                }
                catch (FormatException)
                {
                    ds.IsNeedCheck = 1;
                }
                try
                {
                    ds.CheckpointIndex = Int32.Parse(this.dataGridView_domain.Rows[selectRow].Cells["Column_domain_checkPoint"].Value.ToString());
                }
                catch (FormatException)
                {
                    ds.CheckpointIndex = 0;
                }
                ds.Creator = this.dataGridView_domain.Rows[selectRow].Cells["Column_domain_creater"].Value.ToString();
                ds.UpdateDate = this.dataGridView_domain.Rows[selectRow].Cells["Column_domain_createTime"].Value.ToString();
                ds.Comment = this.dataGridView_domain.Rows[selectRow].Cells["Column_domain_remark"].Value.ToString();
                List<string> checkPointList = GetCheckPointNameList();
                if (checkPointList.Count <= 0)
                {
                    MessageBox.Show("当前没有有效监测点，无法修改域名，请先创建监测点");
                }
                else{
                    createDomain form = new createDomain(ds, checkPointList, this._userName, true);
                    if (form.ShowDialog() == DialogResult.OK)
                    {
                        int nCount = InitDomain();
                        if (nCount >= 0)
                        {
                            _gDomainCount = nCount;
                            if (_gDomainCount % GDomainPageSize == 0)
                            {
                                _gDomainPage = _gDomainCount / GDomainPageSize;
                            }
                            else
                            {
                                _gDomainPage = _gDomainCount / GDomainPageSize + 1;
                            }

                            UpdateTotalDomainUi();
                            GetPageDomain();
                            UdpdatePageDomainUi();
                        }
                    }
                }
            }
            // 删除本域名
            else if (selectColumn == deleteColumn)
            {
                int domainIndex = 0;
                try
                {
                    domainIndex = Int32.Parse(this.dataGridView_domain.Rows[selectRow].Cells["Column_domain_domainIndex"].Value.ToString());
                }
                catch (FormatException)
                {
                    domainIndex = 0;
                }
                if (MessageBox.Show("确定删除吗？", "提示", MessageBoxButtons.OKCancel) == DialogResult.OK)
                {
                    var request = new Request();
                    var deleteDomainRequest = new DeleteDomainRequest
                    {
                        DomainIndex = domainIndex
                    };
                    //var ip = IniConfigMgr.IniInstance.LoadConfig("服务器IP");
                    var apiPath = Api.DeleteDomain;
                    var result = request.Execute<DeleteDomainResponse>(apiPath, deleteDomainRequest.ToJson(), "POST");
                    if (result is string)
                    {
                        MessageBox.Show("错误：" + result);
                    }
                    else {
                        int nCount = InitDomain();
                        if (nCount >= 0)
                        {
                            _gDomainCount = nCount;
                            if (_gDomainCount % GDomainPageSize == 0)
                            {
                                _gDomainPage = _gDomainCount / GDomainPageSize;
                            }
                            else
                            {
                                _gDomainPage = _gDomainCount / GDomainPageSize + 1;
                            }

                            UpdateTotalDomainUi();
                            GetPageDomain();
                            UdpdatePageDomainUi();
                        }
                    }
                }
            }
            // 修改域名状态
            else if (selectColumn == checkStatusColumn) 
            {
                var request = new Request();
                int isNeedCheck = 1;
                int domainIndex = 0;
                try
                {
                    domainIndex = Int32.Parse(this.dataGridView_domain.Rows[selectRow].Cells["Column_domain_domainIndex"].Value.ToString());
                }
                catch (FormatException)
                {
                    domainIndex = 0;
                }
                try
                {
                    DataGridViewCheckBoxCell checkcell = (DataGridViewCheckBoxCell)this.dataGridView_domain.Rows[selectRow].Cells["Column_domain_checkStatus"];
                    if (String.Compare(checkcell.Value.ToString(), "0") == 0)
                    {
                        isNeedCheck = 1;
                    }
                    else {
                        isNeedCheck = 0;
                    }
                }
                catch (FormatException)
                {
                    isNeedCheck = 1;
                }

                var updateDomainCheckedRequest = new UpdateDomainCheckedRequest
                {
                    DomainIndex = domainIndex,
                    IsNeedCheck = isNeedCheck
                };
                //var ip = IniConfigMgr.IniInstance.LoadConfig("服务器IP");
                var apiPath = Api.UpdateDomainChecked;
                var result = request.Execute<UpdateDomainCheckedResponse>(apiPath, updateDomainCheckedRequest.ToJson(), "POST");
                if (result is string)
                {
                    MessageBox.Show("错误：" + result);
                }
                else {
                    // 刷新本页面
                    int nCount = InitDomain();
                    if (nCount >= 0)
                    {
                        _gDomainCount = nCount;
                        if (_gDomainCount % GDomainPageSize == 0)
                        {
                            _gDomainPage = _gDomainCount / GDomainPageSize;
                        }
                        else
                        {
                            _gDomainPage = _gDomainCount / GDomainPageSize + 1;
                        }

                        UpdateTotalDomainUi();
                        GetPageDomain();
                        UdpdatePageDomainUi();
                    }
                }
            }
        }

